import React from "react";

export const Registration_BusinessPage = () => {

    const Field_Dispenser = (type,name,id,value) => {

        return <React.Fragment>

        <div
        style={{
            width: 'inherit',

            display:'flex',
            flexDirection:'row',
            justifyContent:'space-around',

            border: 'black solid 5px'

        }}
        >

            <label htmlFor={id}
            style={{

            }}
            >
            {name.toUpperCase()}
            </label>
            
            <input 
            type={type}
            name={name}
            id={id}
            value={value}
            ></input>

        </div>

        </React.Fragment>

    }

    return <React.Fragment>
            <div
            style={{
            width:'inherit',
            height:'inherit',
            
            display:'flex',
            flexDirection:'row',

            justifyContent:'center',
            alignItems: 'center'
            }}
            >

                <div
                style={{
                    minWidth: '70vw',
                    backgroundColor: 'white',
                    padding: '6vh 7vw',
                    borderRadius: '15px',
                    border: 'black solid 1.5px'
                }}
                >

                    <div>
                        
                        {Field_Dispenser('text','name','name')}

                        <input
                        type="email"
                        name='email'
                        ></input>

                        <input
                        type='text'
                        name='ID'
                        ></input>

                        <input
                        type="text"
                        name='PASSWORD'
                        ></input>

                        <input
                        type='text'
                        name='position'
                        value='business'
                        ></input>

                    </div>

                </div>

            </div>

        </React.Fragment>
    

}

export default Registration_BusinessPage
